import { createSlice } from "@reduxjs/toolkit";

const planSlice = createSlice({
  name: "plan",
  initialState: "",
  reducers: {
    changePlan(state, action) {
      state = action.payload;
    },
  },
});
export const { planReducer } = planSlice.reducer;
export const { changePlan } = planSlice.actions;
